  return (
    <div className="container">
      <nav className="nav">
        <div className="logo">Farmerize</div>
        <div className="searchbar">
          <SearchBar />
        </div>
        <ul className="nav-links">
          <li>test</li>
        </ul>
      </nav>
    </div>
  );
};

export default NavBar;
